import Foundation

struct ForecastData: Decodable {
    let cod: String?
    let message: Int?
    let cnt: Int?
    let list: [ForecastInfo]?
    let city: City?
}

struct ForecastInfo: Decodable {
    let dt: Int?
    let main: ForecastMain?
    let weather: [Weather]?
    let clouds: Clouds?
    let wind: Wind?
    let visibility: Int?
    let pop: Double?
    let rain: Rain?
    let sys: Sys?
    let dtTxt: String?

    enum CodingKeys: String, CodingKey {
        case dt, main, weather, clouds, wind, visibility, pop, rain, sys
        case dtTxt = "dt_txt"
    }
}

struct ForecastMain: Decodable {
    let temp: Double?
    let feelsLike: Double?
    let tempMin: Double?
    let tempMax: Double?
    let pressure: Int?
    let seaLevel: Int?
    let grndLevel: Int?
    let humidity: Int?
    let tempKf: Double?

    enum CodingKeys: String, CodingKey {
        case temp, feelsLike, tempMin, tempMax, pressure, seaLevel, grndLevel, humidity, tempKf
    }
}


struct Rain2: Decodable {
    let threeH: Double?

    enum CodingKeys: String, CodingKey {
        case threeH = "3h"
    }
}

struct Sys2: Decodable {
    let pod: String?
}

struct City: Decodable, Identifiable {
    let id: Int?
    let name: String?
    let coord: Coord?
    let country: String?
    let population: Int?
    let timezone: Int?
    let sunrise: Int?
    let sunset: Int?
}


